// Check screen size on page load
document.addEventListener("DOMContentLoaded", function() {
    checkScreenSize();
});

// Check screen size when the window is resized
window.addEventListener("resize", function() {
    checkScreenSize();
});

function checkScreenSize() {
    const screenWidth = window.innerWidth || document.documentElement.clientWidth || document.body.clientWidth;

    if (screenWidth < 768) {
        showOverlay("Access not allowed on mobile devices. Please use a laptop or device with a screen size of 768 pixels or greater.");
    } else {
        hideOverlay();
    }
}

function showOverlay(message) {
    // Create overlay elements
    const overlay = document.createElement("div");
    overlay.style.position = "fixed";
    overlay.style.top = "0";
    overlay.style.left = "0";
    overlay.style.width = "100%";
    overlay.style.height = "100%";
    overlay.style.backgroundColor = "rgba(0, 0, 0, 0.7)";
    overlay.style.color = "white";
    overlay.style.display = "flex";
    overlay.style.alignItems = "center";
    overlay.style.justifyContent = "center";
    overlay.style.zIndex = "9999";

    // Create message element
    const messageElement = document.createElement("div");
    messageElement.textContent = message;

    // Append message to overlay
    overlay.appendChild(messageElement);

    // Append overlay to the body
    document.body.appendChild(overlay);
}

function hideOverlay() {
    // Remove the overlay
    const overlay = document.querySelector("div[role='overlay']");
    if (overlay) {
        overlay.remove();
    }
}

