// pdf template code
function createDocumentDefinition(certificateNumber) {
    // Store FormData
    const rawCertDate = document.getElementById('certdate').value;
    const rawDatedEWastePickedOn = document.getElementById('datedEWastePickedOn').value;
    const DescCompanyName = document.getElementById('DescCompanyName').value;
    const companyName = document.getElementById('companyName').value;
    const companyAddress = document.getElementById('companyAddress').value;
    const amountOfEWaste = document.getElementById('amountOfEWaste').value;
    const InvoiceNoBOENo = document.getElementById('InvoiceNoBOENo').value;

    // Convert input strings to Date objects
    const CertGenDate = new Date(rawCertDate);
    const datedEWastePickedOn = new Date(rawDatedEWastePickedOn);

    // Format dateAndTime as 'dd-mm-yyyy'
    const formattedCertGenDate = `${CertGenDate.getDate()}-${CertGenDate.getMonth() + 1}-${CertGenDate.getFullYear()}`;

    // Format datedEWastePickedOn as 'DDth of Month YYYY'
    const optionsDate = { day: 'numeric', month: 'long', year: 'numeric' };
    const formattedDatedEWastePickedOn = datedEWastePickedOn.toLocaleDateString('en-US', optionsDate).replace(/(\d)(?=(\d{2})+\d{2})/g, '$1th');    
    return {
        pageOrientation: 'landscape',
        defaultStyle: {
            font: 'EBGaramond'
        },
        content: [
            {
                columns: [
                    {
                        text: `Date: ${formattedCertGenDate}\nCertificate Number: ${certificateNumber}\nMPCB CONSENT NO : /RO-HQ/UAN No.0000167386/CO/2305001943 dated 24/01/2023.`,
                        width: 520,
                        style: 'date_dc'
                    },
                ],
            },
            {text: [`\nThis document serves as confirmation that `, {text: `Western Recycler`, bold: true, fontSize: 16}, ` has officially taken possession and ownership of outdated \nElectric Equipment, Total `, {text: `${amountOfEWaste} Kg`, bold: true, fontSize: 16}, ` of E-Waste collected from `, {text: `${DescCompanyName}`, bold: true, fontSize: 16} ,` \non dated `, {text: `${formattedDatedEWastePickedOn}`, bold: true, fontSize: 16} , ` on the basis of `, {text: ` Invoice No/ BOE No :`, bold: true} ,` `, {text: `(${InvoiceNoBOENo})`} ,`.`], style: `cert_desc`},
            {text: 'The electronic waste listed in Annexure 1 has undergone an environmentally friendly recycling process, \nminimizing the impact on the planet and promoting the reuse of valuable resources.', style: 'c_n_adddd' },
            {text: [{text: `${companyName}`, bold: true} , {text: ` ${companyAddress}`} ,'.'], style: 'c_n_add' },
            {text: ['We applaud ',{text: `${companyName}`, bold: true} , {text: ' for their commitment to environmental stewardship \nand commend their efforts in promoting a greener and more sustainable future.'} ,'.'], style: 'c_n_addd' },
            {
                image: 'data:image/png;base64,',
                width: 85,
                style: 'asset',
            },
        ],
        background: [
            {
                image: 'data:image/png;base64,',
                width: 850,
            },
        ],
        styles: {
            date_dc: {margin: [-20, -27, 0, 0], lineHeight: 1.5, bold: true, fontSize: 13, color:'white'},
            cert_desc: {margin: [0, 73, 0, 0], lineHeight: 1.4, fontSize: 16, alignment: 'center'},
            c_n_add: {margin: [0,18, 0, 0], alignment: 'center', fontSize: 15},
            c_n_adddd: {margin: [0, 8, 0, 0], alignment: 'center', fontSize: 12},        
            c_n_addd: {margin: [0,15, 0, 0], alignment: 'center', fontSize: 12},
            asset: {margin: [590, 28, 0, 0]}
        },
    };
}

// to generate pdf and view it on server side
function generatePDF() {    
    const xhr = new XMLHttpRequest();
    xhr.open("GET", "./private/get_counter.php", true);
    xhr.onreadystatechange = function () {
        if (xhr.readyState == 4 && xhr.status == 200) {
            const certificateNumber = xhr.responseText.trim();
            console.log("Certificate Number:", certificateNumber);

            const documentDefinition = createDocumentDefinition(certificateNumber);

            pdfMake.createPdf(documentDefinition).open();
        }
    };
    xhr.send();
}

// to submit the form data into a log file and download the pdf
function submitForm() {
    const xhr = new XMLHttpRequest();
    xhr.open("GET", "./private/get_counter.php", true);
    xhr.onreadystatechange = function () {
        if (xhr.readyState == 4 && xhr.status == 200) {
            const certificateNumber = xhr.responseText.trim();
            console.log("Certificate Number:", certificateNumber);

            // comapny name
            const companyName = document.getElementById('companyName').value;

            // Create documentDefinition using the function
            const documentDefinition = createDocumentDefinition(certificateNumber);

            // Generate PDF
            const pdfDoc = pdfMake.createPdf(documentDefinition);
            
            pdfDoc.download(`${certificateNumber}_${companyName}.pdf`);       
                        
            // Proceed with submitting the data to the server
            const log_certdate = "Certificate Date " + document.getElementById('certdate').value;
            const log_datedEWastePickedOn = document.getElementById('datedEWastePickedOn').value;
            const log_DescCompanyName = document.getElementById('DescCompanyName').value;
            const log_companyName = document.getElementById('companyName').value;
            const log_companyAddress = document.getElementById('companyAddress').value;
            const log_amountOfEWaste = document.getElementById('amountOfEWaste').value;
            const log_InvoiceNoBOENo = document.getElementById('InvoiceNoBOENo').value;

            // AJAX request to PHP for saving data
            const xhrSave = new XMLHttpRequest();
            xhrSave.open("POST", "./private/save_data.php", true);
            xhrSave.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
            xhrSave.onreadystatechange = function () {
                if (xhrSave.readyState == 4 && xhrSave.status == 200) {
                    console.log(xhrSave.responseText);                
                }                
            };
            xhrSave.send(`log_certdate=${log_certdate}&log_datedEWastePickedOn=${log_datedEWastePickedOn}&log_DescCompanyName=${log_DescCompanyName}&log_companyName=${log_companyName}&log_companyAddress=${log_companyAddress}&log_amountOfEWaste=${log_amountOfEWaste}&log_InvoiceNoBOENo=${log_InvoiceNoBOENo}`);
        }
    };
    xhr.send();    
    setTimeout(() => {
        window.location.reload();
    }, 900);        
}
